/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import './Header.css'
import logo from '../../assets/img/NPMLogo.png'
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import { Image, Button } from 'react-bootstrap';


export default function  Header() {
  return (
    <Navbar >
    <Container fluid="xxl" >
      <Navbar.Brand href="#home">
     <Image  src={logo} style={{height: "1.8rem", marginRight: "0.5rem"}} />
     <Nav.Item>LaslesNPM</Nav.Item>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link href="#features">About</Nav.Link>
          <Nav.Link href="#pricing">Features</Nav.Link>
          <Nav.Link href="#pricing">Testimonials</Nav.Link>
          <Nav.Link href="#pricing">Help</Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link>Sing Up</Nav.Link>
          <Button variant="outline-dark" size="sm">Sing Up</Button>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
  );
}
